import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import { FaSearch, FaFilter } from 'react-icons/fa';

const MOCK_TECHNIQUES = [
  {
    id: '1',
    name: 'Pêche au coup',
    difficulty: 'Facile',
    description: 'La pêche au coup est une technique de pêche très populaire, particulièrement adaptée aux débutants.',
    imageUrl: 'https://images.unsplash.com/photo-1516962126636-27ad087061cc?w=800'
  },
  {
    id: '2',
    name: 'Pêche aux leurres',
    difficulty: 'Intermédiaire',
    description: 'La pêche aux leurres est une technique active qui consiste à attraper les poissons carnassiers en imitant leurs proies naturelles.',
    imageUrl: 'https://images.unsplash.com/photo-1595183405644-6b3b0f6538bd?w=800'
  },
  {
    id: '3',
    name: 'Pêche à la mouche',
    difficulty: 'Difficile',
    description: 'La pêche à la mouche est une technique élégante qui imite les insectes dont se nourrissent les poissons.',
    imageUrl: 'https://images.unsplash.com/photo-1499242611767-cf8b9be02854?w=800'
  }
];

const Catalog = () => {
  const [searchTerm, setSearchTerm] = useState('');
  const [selectedDifficulty, setSelectedDifficulty] = useState('');
  const [isFilterOpen, setIsFilterOpen] = useState(false);

  const filteredTechniques = MOCK_TECHNIQUES.filter(technique => {
    const matchesSearch = technique.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
                         technique.description.toLowerCase().includes(searchTerm.toLowerCase());
    const matchesDifficulty = !selectedDifficulty || technique.difficulty === selectedDifficulty;
    return matchesSearch && matchesDifficulty;
  });

  const difficulties = [...new Set(MOCK_TECHNIQUES.map(technique => technique.difficulty))];

  const getDifficultyColor = (difficulty) => {
    switch (difficulty) {
      case 'Facile':
        return 'bg-green-100 text-green-800';
      case 'Intermédiaire':
        return 'bg-yellow-100 text-yellow-800';
      case 'Difficile':
        return 'bg-red-100 text-red-800';
      default:
        return 'bg-gray-100 text-gray-800';
    }
  };

  return (
    <div className="max-w-6xl mx-auto px-4 py-8">
      <div className="flex flex-col md:flex-row justify-between items-center mb-8">
        <h1 className="text-3xl font-bold text-nature-blue mb-4 md:mb-0">Catalogue des Techniques</h1>

        <div className="flex items-center space-x-4 w-full md:w-auto">
          <div className="relative flex-grow md:flex-grow-0">
            <input
              type="text"
              placeholder="Rechercher une technique..."
              value={searchTerm}
              onChange={(e) => setSearchTerm(e.target.value)}
              className="w-full px-4 py-2 rounded-lg border focus:outline-none focus:border-nature-blue"
            />
            <FaSearch className="absolute right-3 top-3 text-gray-400" />
          </div>

          <button
            onClick={() => setIsFilterOpen(!isFilterOpen)}
            className="flex items-center space-x-2 px-4 py-2 bg-nature-blue text-white rounded-lg hover:bg-nature-blue-dark"
          >
            <FaFilter />
            <span>Filtrer</span>
          </button>
        </div>
      </div>

      {isFilterOpen && (
        <div className="mb-8 p-4 bg-gray-50 rounded-lg">
          <h2 className="font-semibold mb-4">Filtrer par difficulté</h2>
          <div className="flex flex-wrap gap-2">
            <button
              onClick={() => setSelectedDifficulty('')}
              className={`px-3 py-1 rounded-full ${
                selectedDifficulty === '' 
                  ? 'bg-nature-blue text-white' 
                  : 'bg-gray-200 text-gray-700 hover:bg-gray-300'
              }`}
            >
              Toutes
            </button>
            {difficulties.map(difficulty => (
              <button
                key={difficulty}
                onClick={() => setSelectedDifficulty(difficulty)}
                className={`px-3 py-1 rounded-full ${
                  selectedDifficulty === difficulty 
                    ? 'bg-nature-blue text-white' 
                    : 'bg-gray-200 text-gray-700 hover:bg-gray-300'
                }`}
              >
                {difficulty}
              </button>
            ))}
          </div>
        </div>
      )}

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        {filteredTechniques.map(technique => (
          <Link
            to={`/catalog/${technique.id}`}
            key={technique.id}
            className="bg-white rounded-lg shadow-lg overflow-hidden transform transition duration-200 hover:scale-105"
          >
            <div className="relative h-48">
              <img
                src={technique.imageUrl}
                alt={technique.name}
                className="w-full h-full object-cover"
              />
              <div className="absolute top-2 right-2">
                <span className={`px-2 py-1 bg-white bg-opacity-90 rounded-full text-sm ${getDifficultyColor(technique.difficulty)}`}>
                  {technique.difficulty}
                </span>
              </div>
            </div>
            <div className="p-4">
              <h2 className="text-xl font-bold text-nature-blue mb-2">{technique.name}</h2>
              <p className="text-gray-600 line-clamp-2">{technique.description}</p>
              <div className="mt-4 flex justify-end">
                <span className="text-nature-blue hover:underline">Plus d'informations →</span>
              </div>
            </div>
          </Link>
        ))}
      </div>

      {filteredTechniques.length === 0 && (
        <div className="text-center py-12">
          <p className="text-gray-600">Aucune technique ne correspond à votre recherche.</p>
        </div>
      )}
    </div>
  );
};

export default Catalog;
